import React from 'react';
import './App.css';
import Donations from './Components/Donations';
import Progress from './Components/Progress';
import Form from './Components/Form';

function App() {
  return (
    <div className="App">
      <div className='container'>
        <div className='row'>
          <Donations />
            <div className='col-8'>
              <Progress />
              <Form />

            </div>

        </div>
      </div>
    </div>
  );
}

export default App;
